sap.ui.define(["sap/ui/core/mvc/Controller","sap/base/strings/formatMessage","sap/m/ValueColor"],function(e,t,o){"use strict";return e.extend("kc.sensormanager.controller.SensorStatus",{formatMessage:t,onInit:function(){this.getOwnerComponent().getRouter().getRoute("RouteSensorStatus").attachMatched(this.onRouteMatched,this)},onRouteMatched:function(e){this.getView().bindElement({path:"/sensors/"+e.getParameter("arguments").index,model:"sensorModel"})},formatValueColor:function(e,t){e=e||{};if(t<e.warm){return o.Neutral}else if(t>=e.warm&&t<e.hot){return o.Critical}else{return o.Error}},navToSensors:function(){this.getOwnerComponent().getRouter().navTo("RouteSensors")}})});